import React from 'react'

class InterfacePage extends React.Component<{props: any},{}> {

  render(){
    return(
      <div>
      <div>
      <h1></h1>
      <div>
        ur name is {props.name}
      </div>
      </div>
      </div>
    )
  }
}

export default InterfacePage
